import datetime
from enum import Enum
from typing import List, Dict, Optional
from uuid import uuid4
from functools import lru_cache

class UserRole(Enum):
    ADMIN = "admin"
    BROKER = "broker"
    DATA_ANALYST = "data_analyst"
    DEVELOPER = "developer"
    UI_DESIGNER = "ui_designer"
    TESTER = "tester"
    DATA_ENGINEER = "data_engineer"

class SubmissionType(Enum):
    FABS = "fabs"
    DABS = "dabs"

class SubmissionStatus(Enum):
    DRAFT = "draft"
    PUBLISHED = "published"
    FAILED = "failed"

class User:
    def __init__(self, user_id: str, username: str, role: UserRole):
        self.user_id = user_id
        self.username = username
        self.role = role

class Submission:
    def __init__(self, submission_id: str, submission_type: SubmissionType, created_by: User):
        self.submission_id = submission_id
        self.submission_type = submission_type
        self.created_by = created_by
        self.status = SubmissionStatus.DRAFT
        self.created_at = datetime.datetime.now()
        self.updated_at = datetime.datetime.now()
        self.errors = []
        self.warnings = []
        self.data = {}

    def update_status(self, new_status: SubmissionStatus):
        self.status = new_status
        self.updated_at = datetime.datetime.now()

    def add_error(self, error: str):
        self.errors.append(error)

    def add_warning(self, warning: str):
        self.warnings.append(warning)

    def validate_dabs(self) -> bool:
        if self.submission_type == SubmissionType.DABS:
            if "duns_number" not in self.data:
                self.add_error("DUNS number is required for DABS submissions")
                return False
        return True

    def derive_fabs_fields(self):
        if self.submission_type == SubmissionType.FABS:
            if "funding_agency" in self.data:
                self.data["funding_agency_code"] = f"FAC-{self.data['funding_agency'][:3].upper()}"

class SubmissionManager:
    def __init__(self):
        self.submissions = {}

    def create_submission(self, submission_type: SubmissionType, user: User) -> Submission:
        submission_id = str(uuid4())
        submission = Submission(submission_id, submission_type, user)
        self.submissions[submission_id] = submission
        return submission

    def publish_submission(self, submission_id: str) -> bool:
        submission = self.submissions.get(submission_id)
        if not submission:
            return False
        if submission.validate_dabs():
            submission.derive_fabs_fields()
            submission.update_status(SubmissionStatus.PUBLISHED)
            return True
        else:
            submission.update_status(SubmissionStatus.FAILED)
            return False

    def get_submission(self, submission_id: str) -> Optional[Submission]:
        return self.submissions.get(submission_id)

