class GTASWindow:
    def __init__(self):
        self.start_date = None
        self.end_date = None

    def set_window(self, start_date: datetime.datetime, end_date: datetime.datetime):
        self.start_date = start_date
        self.end_date = end_date

class UIIssue:
    def __init__(self, issue_id: str, component: str, description: str, reported_by: User):
        self.issue_id = issue_id
        self.component = component
        self.description = description
        self.reported_by = reported_by
        self.reported_at = datetime.datetime.now()
        self.status = "open"

class UIIssueTracker:
    def __init__(self):
        self.issues = []

    def report_issue(self, component: str, description: str, user: User) -> UIIssue:
        issue_id = str(uuid4())
        issue = UIIssue(issue_id, component, description, user)
        self.issues.append(issue)
        return issue

    def generate_test_report(self) -> List[Dict]:
        return [{
            "issue_id": issue.issue_id,
            "component": issue.component,
            "status": issue.status
        } for issue in self.issues]

class TestingSession:
    def __init__(self, session_id: str, scheduled_by: User, start_time: datetime.datetime, end_time: datetime.datetime):
        self.session_id = session_id
        self.scheduled_by = scheduled_by
        self.start_time = start_time
        self.end_time = end_time
        self.participants = []

    def add_participant(self, user: User):
        self.participants.append(user)

class TestingScheduler:
    def __init__(self):
        self.sessions = []

    def schedule_session(self, scheduled_by: User, start_time: datetime.datetime, end_time: datetime.datetime) -> TestingSession:
        session_id = str(uuid4())
        session = TestingSession(session_id, scheduled_by, start_time, end_time)
        self.sessions.append(session)
        return session

class HistoricalDataLoader:
    def load_historical_fabs(self, data: List[Dict]):
        for record in data:
            record["derived_field"] = f"derived_{record.get('id', 'default')}"

    def load_fpds_data(self, data: List[Dict], historical_filter: Optional[datetime.datetime] = None):
        if historical_filter:
            return [record for record in data if record.get("date", datetime.datetime.min) >= historical_filter]
        return data
